import React from 'react'
import styled from 'styled-components';
import './page.css';
import './slider.css';
import logo1 from './../img/logo1.png';
import { Link } from 'react-router-dom'; 
import List1 from './List1';
import Slider from 'react-slick';
import img1 from "./../img/img2.png";
import img2 from "./../img/img3.png";
const Container = styled.div`
    height: 80px;
    background-color:#2C6C70;
   `
const Wrapper = styled.div`

 display:flex;
 
`
const Home =styled.div`
font-family: sans-serif;
font-size:13px;
color:white;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
 font-weight: bold;
`
const About = styled.div`
font-weight: bold;
font-family: sans-serif;
font-size:13px;
color:white;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
`
const List = styled.div`
font-weight: bold;
font-family: sans-serif;
font-size:13px;
color:white;
 letter-spacing:0.15em;
 padding: 30px 30px 20px 30px;
`
const Logo = styled.div`
width:400px;
color:white;
`
const Search = styled.div`
border: 0.5px solid white;;
display:flex;
width: 250px;
height:25px;
color:white;
margin-top: 25px;
margin-left:60px;


`


const Navbar = () => {
    var settings = {
        dots: true,
        infinite: true,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1300,
        
      };
    return (
        <div>
       <Container>
           <Wrapper>
           <Logo className='Logo'>
              <img src={logo1}></img>
              </Logo>
              <Home className='Home'>
                  <Link to={`/`} >TRANG CHỦ</Link>
              </Home>
              <List className='List'>
                  DANH SÁCH 
              </List>
              <About className='About'>
                  LIÊN HỆ
              </About>
              
              
              <Search>
                <input className='input' placeholder='TÌM KIẾM' ></input>
                <i class="fas fa-search"></i>
              </Search>
              
           </Wrapper>
       </Container>
       <div className='slider'>
        <div className='content'>

        </div>
           <div className='slideshow'>
      
        <Slider {...settings}>
          <div className='slideshow1'>
            <h3 className='imgslide'><img src={img1}></img></h3>
          </div>
          <div>
          <h3 className='imgslide'>  <img src={img2}></img></h3>
          </div>
         
        </Slider>
      </div>
      </div>
        



       </div>
    )
}





export default Navbar
